import React from 'react';
import activities from '../styles/activitiesStyle';

const Activities = (props) =>{
    return(
        <div style={activities.activities_reset}>

    <div style={activities.activities_header}>

        <h3 style={activities.activities_h3}>Recent Activities</h3>

        <ul style={activities.activities_ul}>
            <li style={activities.activities_li}><a style={activities.activities_a} href='#'>All transaction</a></li>
            <li style={activities.activities_li} ><a style={activities.activities_a} href='#'>Earnings</a></li>
            <li style={activities.activities_li} ><a style={activities.activities_a} href='#'>Expenses</a></li>
        </ul>
        <div>
            </div>
        </div>

            </div>
    )
}

export default Activities;
